import { useNavigation } from "@react-navigation/native"
import React from "react"
import { Button, View } from "react-native"

export default function NavigationBar({previous, next, callback}: Props) {
  const navigation = useNavigation()
    return (
      <View style={{flex: 1, flexDirection: 'row', backgroundColor: 'grey'}}>
        <View style={{flex: 1, alignItems: 'center', justifyContent: 'center'}}>
          <Button title='Previous' onPress={() => navigation.navigate(previous)}/>
        </View>
        <View style={{flex: 1, alignItems: 'center', justifyContent: 'center'}}>
          <Button title='Next' onPress={() => onNextButton(navigation, next, callback)}/>
        </View>
      </View>
    )
}

function onNextButton(navigation: any, next: string, callback:  () => void) {
  callback()
  navigation.navigate(next)
}

type Props = { previous: string, next: string, callback?: () => void }
